(254, '๐ ะกััะฐะฝะธัะฐ ะผะพะฝัััะฐ\n\n๐ ะะพะผะฑะธ-ััะบะฒะฐ\n๐ธ ะฃัะพะฒะตะฝั: 1\n๐บ ะะพะฝะฐ ะพัะพัั: *ัะบัััะพ*\n\nะะฐะณัะฐะดะฐ ะทะฐ ัะฑะธะนััะฒะพ:\nโจ ะะฟัั: 250\n๐ฐ ะะพะปะพัะพ: 30\n\nะัะพะฟ ัะตััััะพะฒ:\n๐พ ะัะบะพะปะพะบ ะณะฐัะผะพะฝะธะธ\n๐ ะะธัะฝัะน ัะฒะธัะพะบ ะฑะพะฝััะฐ ะทะฐัะพัะบะธ 5%\n๐ ะะตััะบะฐั ะปะตะฝัะฐ [ะะฒะตะฝั]\n๐จ ๐คด ะะฝะตัะฝะธะน ะฒะธะด: ะัะพัะฝะธะบ ะฝะฐ ะฝะตัะธััั\n๐จ ๐งโโ๏ธ๏ธ ะะฝะตัะฝะธะน ะฒะธะด: ะญะปัั-ะฒะฐะผะฟะธั\n๐จ ๐งโโ๏ธ ะะฝะตัะฝะธะน ะฒะธะด: ะัะบ-ะฟัะธะทัะฐะบ\n๐ฑ ะขัะบะฒะตะฝะฝะฐั ัะตะผะตัะบะฐ [ะะฒะตะฝั]\n๐ ะขะฐะปะฐะฝั - ะะพััะพัะธัะตะปั [ะะฒะตะฝั]\n๐ฎ ะะพะปะปะตะบัะธั ะดัั [ะะฒะตะฝั]\n๐ช ะะตัะตะฝัะบะฐ\n๐ ะกะฒะธัะพะบ ัะดะฐัะธ\n๐ฒ ะะพะผะตะฝัะฐะปัะฝะฐั ะปะพัะตัะตั\n๐ ะะธัะฝัะน ัะฒะธัะพะบ ะฑะปะฐะณะพัะปะพะฒะตะฝะธั\n๐ฐ ะะพัะตะปั ั ะทะพะปะพัะพะผ (100)\n๐ฐ ะะพัะพะผะบะฐ ั ะทะพะปะพัะพะผ (250)\n๐ฐ ะะตัะพะบ ั ะทะพะปะพัะพะผ (600)\n๐ ะะตะทะพะฟะฐัะฝัะน ัะฒะธัะพะบ ะทะฐัะพัะบะธ [III]\n๐ฎ ะัะฐะทะดะฝะธัะฝัะน ัะพะฝะฐัั\n๐ ะัะฐะทะดะฝะธัะฝัะน ะฟะฐะบะตั\n๐ ะกะฒะธัะพะบ ะทะฐัะพัะบะธ [III]\n๐ ะัะบะพะปะพะบ ะดััะธ [ะะฒะตะฝั]\n๐ก๐ ะะธัะฝะพะต ะทะตะปัะต ะพัะธัะตะฝะธั ะบะฐะผะฝั [II]\n๐ ะะตะทะพะฟะฐัะฝัะน ัะฒะธัะพะบ ะทะฐัะพัะบะธ [IV]\n๐ ะัะบะพะปะพะบ ัะฐะพัะฐ\n๐ ะกะฒะธัะพะบ ะทะฐัะพัะบะธ [IV]\n๐ชฆ ะะตัะบะฐ ะฟัะธะบะปััะตะฝะธั\n๐บ ะงะฐััั ะบะฐััั ัะพะบัะพะฒะธั\n๐ ะะตัะพะบ ะผะฐัะตัะธะธ', '๐ ะะพะผะฑะธ-ััะบะฒะฐ', 1, NULL, '*ัะบัััะพ*', 250, 30, '[\"๐พ ะัะบะพะปะพะบ ะณะฐัะผะพะฝะธะธ\", \"๐ ะะธัะฝัะน ัะฒะธัะพะบ ะฑะพะฝััะฐ ะทะฐัะพัะบะธ 5%\", \"๐ ะะตััะบะฐั ะปะตะฝัะฐ [ะะฒะตะฝั]\", \"๐จ ๐คด ะะฝะตัะฝะธะน ะฒะธะด: ะัะพัะฝะธะบ ะฝะฐ ะฝะตัะธััั\", \"๐จ ๐งโโ๏ธ๏ธ ะะฝะตัะฝะธะน ะฒะธะด: ะญะปัั-ะฒะฐะผะฟะธั\", \"๐จ ๐งโโ๏ธ ะะฝะตัะฝะธะน ะฒะธะด: