(308, '๐ ะกััะฐะฝะธัะฐ ะผะพะฝัััะฐ\n\n๐ฆฏโ๏ธ ะะปะพะน ัะฝะตะณะพะฒะธะบ ั ะฟะฐะปะบะพะน\n๐ธ ะฃัะพะฒะตะฝั: 1\n๐บ ะะพะฝะฐ ะพัะพัั: *ัะบัััะพ*\n\nะะฐะณัะฐะดะฐ ะทะฐ ัะฑะธะนััะฒะพ:\nโจ ะะฟัั: 250\n๐ฐ ะะพะปะพัะพ: 30\n\nะัะพะฟ ัะตััััะพะฒ:\n๐จ ๐คด ะะฝะตัะฝะธะน ะฒะธะด: ะะฐัะปะตะดะฝะธะบ ัะตะฒะตัะฐ\n๐จ ๐งโโ๏ธ ะะฝะตัะฝะธะน ะฒะธะด: ะัะธะฝั ะทะธะผั\n๐จ ๐งโโ๏ธ ะะฝะตัะฝะธะน ะฒะธะด: ะะพะธะฝั ัะตะฒะตัะฐ\n๐ ะกะฒะธัะพะบ ะพัะพัะฝะธะบะฐ\n๐  ะะพะฒ ัััะฐะฝะฝะธะบะฐ\n๐ก๐ ะะธัะฝะพะต ะทะตะปัะต ะพัะธัะตะฝะธั ะบะฐะผะฝั [IV]\n๐ช ะะตัะตะฝัะบะฐ\n๐ ะกะฒะธัะพะบ ัะดะฐัะธ\n๐ฒ ะะพะผะตะฝัะฐะปัะฝะฐั ะปะพัะตัะตั\n๐ ะะธัะฝัะน ัะฒะธัะพะบ ะฑะปะฐะณะพัะปะพะฒะตะฝะธั\n๐ฐ ะะพัะตะปั ั ะทะพะปะพัะพะผ (100)\n๐ฐ ะะพัะพะผะบะฐ ั ะทะพะปะพัะพะผ (250)\n๐ ะะตะทะพะฟะฐัะฝัะน ัะฒะธัะพะบ ะทะฐัะพัะบะธ [III]\n๐ฎ ะัะฐะทะดะฝะธัะฝัะน ัะพะฝะฐัั\n๐ ะัะฐะทะดะฝะธัะฝัะน ะฟะฐะบะตั\n๐ฐ ะะตัะพะบ ั ะทะพะปะพัะพะผ (600)\n๐ ะัะบะพะปะพะบ ัะฐะพัะฐ\n๐ ะกะปััะฐะนะฝัะน ะบะฐะผะตะฝั ัะฐะพัะฐ\n๐ ะะฐะผะตะฝั ัะฐะพัะฐ\n๐ ะะตัะพะบ ั ะพัะบะพะปะบะฐะผะธ ัะฐะพัะฐ 5ัั\n๐ ะะตะทะพะฟะฐัะฝัะน ัะฒะธัะพะบ ะทะฐัะพัะบะธ [IV]\n๐ ะกะฒะธัะพะบ ะทะฐัะพัะบะธ [II]\n๐ ะกะฒะธัะพะบ ะทะฐัะพัะบะธ [IV]\n๐ชฆ ะะตัะบะฐ ะฟัะธะบะปััะตะฝะธั\n๐บ ะงะฐััั ะบะฐััั ัะพะบัะพะฒะธั\n๐ชฑ ะงะฐััั ััะฟะฐะปััะฐ\n๐ ะะตัะพะบ ะผะฐัะตัะธะธ\n๐งช ะะตะปัะต ะดะพะฑัััะธะบะฐ [IV]\n๐งช ะะตะปัะต ะดะพะฑัััะธะบะฐ [III]\n๐ ะกะฒะธัะพะบ ะทะฐัะพัะบะธ [III]\n๐ก๐ ะะธัะฝะพะต ะทะตะปัะต ะพัะธัะตะฝะธั ะบะฐะผะฝั [II]\n๐ข ะะปะพัะฝะฐั ะธะณัััะบะฐ [ะะฒะตะฝั]\n๐ฃ ะะปะพัะฝะฐั ะธะณัััะบะฐ [ะะฒะตะฝั]\n๐ ะะพะฒะพะณะพะดะฝัั ะตะปะบะฐ [ะะฒะตะฝั]\nโ๏ธ ะะพะฒะพะณะพะดะฝะธะน ัะฝะตะณะพะฒะธะบ [ะะฒะตะฝั]\nโ๏ธ ะะพะฒะพะณะพะดะฝัั ัะฝะตะถะธะฝะบะฐ [ะะฒะตะฝั]\n๐ ะฃะบัะฐะดะตะฝะฝัะน ะฟะพะดะฐัะพะบ [ะะฒะ